from PySide import QtGui, QtCore
from StringIO import StringIO
from datetime import datetime
try:
   from win32gui import GetWindowText, GetForegroundWindow
   isWin = True
except ImportError:
   isWin = False
import sys, paramiko, os, select, time

# ----------------------------------------------------------------------------
# ici on determine automatiquement si on doit afficher le debug ou non
# sous windows, si le script est lancé via pythonw.exe on affiche pas le debug
# sous linux, si le script est lancé depuis un shell, on affiche le debug
# ----------------------------------------------------------------------------
if isWin:
   DEBUG = os.path.basename(sys.executable) == 'python.exe'
else:
   DEBUG = not os.system('grep $(cat /proc/{}/cmdline) /etc/shells'.format(os.getppid()))
DEBUG_LEVEL = 2	# 1: normal, 2: with chat lines, 3: highly verbose

if DEBUG:
   import inspect

def log(s = '', level=1):
   if DEBUG == True:
      if level <= DEBUG_LEVEL:
         try:
            classname = str(inspect.stack()[1][0].f_locals["self"].__class__).split("'")[1].split('.')[1]
            funcname = inspect.stack()[1][0].f_code.co_name
         except:
            classname = ''
            funcname = '__main__'
         sys.stderr.write('{}  {:<27} : {}\n'.format(datetime.now().strftime('%d/%m %H:%M:%S.%f'), classname + '.' + funcname, s))
         sys.stderr.flush()

